import { Typography, Button, ButtonGroup, Container } from "@mui/material";

export default function Create() {
  return (
    <Container>
      <Typography
        variant="h6"
        component="h2"
        color="textSecondary"
        gutterBottom
      >
        Create a New Note
      </Typography>
      <Button
        variant="contained"
        color="secondary"
        type="submit"
        onClick={() => {
          console.log("button cloicked");
        }}
      >
        Submit
      </Button>
    </Container>
  );
}
